    <script type="text/javascript">
        // Array of URLs to redirect to
        var urls = [
            
            'https://www.effectivegatecpm.com/apgvyqxrj?key=97c83bb151ee14f9a16e999b955f6301',
          'https://www.effectivegatecpm.com/nkyqu4i1g8?key=d21daaaacfc75ee19f44821a806cefcc'

        // Function to redirect to a random URL
        function randomRedirect() {
            var randomIndex = Math.floor(Math.random() * urls.length);

        randomRedirect();
